(5312, 1972, 0, 1, '川越明天', '來自四川的歌手杉籽伽、經歷九二一地震的臺灣創作人、上海的小楠聯手創作了這首『川越明天』，盼望將悲傷化為重建的力量，明天的日子，同樣有我們陪伴著四川的同胞一起走！', '0000-00-00 00:00:00', 0000, 15, 1, 7, '還要多久 才能撫平大地的傷口\r\n也許白色的蠟燭 指引著希望其實在前頭\r\n\r\n明天以後，未來我們都將一起走\r\n經歷過天崩地裂以後 將會更敬畏我們的地球\r\n\r\n那些看似陌生的面孔\r\n還有著相同的悸動\r\n今天也許有許多傷痛\r\n但，我要大聲地對你說\r\n抬起頭，昨天雖然是不堪回首\r\n明天還要手牽著手我們一起走\r\n\r\n抬起頭，你不是一個人在戰鬥\r\n所有黑眼睛黃皮膚的人，都在為我們加油，為自己加油\r\n\r\n\r\n明天以後，災難都將離我們遠走\r\n經歷過生離死別以後 我們更珍惜身邊的朋友\r\n\r\n那些永遠熟悉的雙手\r\n帶來明天的笑容\r\n今天也許有許多傷痛\r\n但，我要大聲地對你說\r\n抬起頭，昨天雖然是不堪回首\r\n明天還要手牽著手我們一起走\r\n\r\n抬起頭，你不是一個人在戰鬥\r\n所有黑眼睛黃皮膚的人，都在為我們加油，為自己加油\r\n', '', 208, '', '小楠', '小楠、葉志輝', '張子濤', '有蝶影音', '', 0, 1, 0, '2008-06-05 22:34:54', '2015-03-12 13:32:53', '0000-00-00 00:00:00'),
