(5355, 1901, 652, 1, '美麗島', '', '2008-06-06 00:00:00', 0000, 20, 0, 17, '', '美麗島 詞/陳秀喜, 梁景峰改寫 曲/李雙澤 演唱/楊祖珺\n\n我們搖籃的美麗島 是母親溫暖的懷抱\n驕傲的祖先們正視著 正視著我們的腳步\n他們一再重覆的叮嚀 不要忘記不要忘記\n他們一再重覆的叮嚀 篳路藍縷以啟山林\n\n婆娑無邊的太平洋 懷抱著自由的土地\n溫暖的陽光照耀著 照耀著高山和田園\n我們這裡有勇敢的人民 蓽路藍縷以啟山林\n我們這裡有無窮的生命 水牛（水牛）稻米（稻米）香蕉（香蕉）玉蘭花', 179, '', '', '', '', '', '', 1, 1, 0, '2008-06-06 12:59:02', '2015-03-12 13:32:55', '0000-00-00 00:00:00'),
