(5360, 1901, 652, 6, '少年中國', '', '2008-06-06 00:00:00', 0000, 20, 0, 17, '', '我們隔著迢遙的山河　去看望祖國的土地\n你用你的足跡　我用我遊子的鄉愁　你對我說\n古老的中國沒有鄉愁　鄉愁是給沒有家的人\n少年的中國也不要鄉愁　鄉愁是給不回家的人\n\n我們隔著迢遙的山河　去看望祖國的土地\n你用你的足跡　我用我遊子的哀歌　你對我說\n古老的中國沒有哀歌　哀歌是給沒有家的人\n少年的中國也不要哀歌　哀歌是給不回家的人\n\n我們隔著迢遙的山河　去看望祖國的土地\n你用你的足跡　我用我遊子的哀歌　你對我說\n少年的中國沒有學校　她的學校是大地的山川\n少年的中國也沒有老師　她的老師是大地的人民', 213, '', '', '', '', '', '', 1, 1, 0, '2008-06-06 14:39:51', '2015-03-12 13:32:55', '0000-00-00 00:00:00'),
