(5368, 1901, 652, 14, '美麗島 (Live 2003)', '', '2008-06-06 00:00:00', 0000, 20, 0, 17, '', '我們搖籃的美麗島 是母親溫暖的懷抱\n驕傲的祖先們正視著 正視著我們的腳步\n他們一再重複地叮嚀\n不要忘記 不要忘記\n他們一再重複地叮嚀\n篳路藍縷 以啟山林\n婆娑無邊的太平洋 懷抱著自由的土地\n溫暖的陽光照耀著 照耀著高山和田園\n我們這裡有勇敢的人民\n篳路藍縷 以啟山林\n我們這裡有無窮的生命\n水牛 稻米 香蕉 玉蘭花', 194, '', '', '', '', '', '', 1, 1, 0, '2008-06-06 15:07:55', '2015-03-12 13:32:55', '0000-00-00 00:00:00'),
