(5370, 242, 0, 1, 'DEMO Overdrive', '', '2009-01-01 00:00:00', 0000, 0, 1, 7, 'Reservation there isn’t for me \r\nThat’s the thought I always think\r\nHow about that coming soon or later\r\nNot my business Hey You Know\r\nCome to me and you’ll see something\r\nThat I promise just on surface\r\nDon’t know what the reason it got\r\nSo I turn on overdrive and drive\r\n\r\nOverdrive and drive take your time to die\r\nLooking to your eyes turning into sky\r\nRight on time is right have you ever minded\r\nFlying to sky better than to die', '', 223, '', '', '', '', '', '', 0, 1, 1, '2008-06-06 16:47:30', '2014-01-19 19:30:01', '2014-01-19 19:30:01'),
(5371, 242, 0, 2, '全民音符 (Demo)', '', '0000-00-00 00:00:00', 0000, 15, 2, 7, '用力跳彩色積雲在腳下\r\n看不見的飛鳥也成群喊叫身邊圍繞\r\n銀灰色樹葉上淺紫的露珠搖晃\r\n空氣爆炸\r\n巨大聲響天空閃亮全民音符出場\r\n\r\n用力搖吉他的神祕技巧\r\n輕量級bass害羞低頭不語盡情想像\r\n全身的硬裝甲突然間四處飛躍\r\n順著扶梯\r\n穿透xxxx整齊結束同時落下\r\n\r\n\r\n嘴裡咬著蘋果派\r\n他們的上面善良但是下面壞\r\n只是喜歡打打砲\r\n全民音符要搖搖擺擺散播愛', '', 182, '', '', '', '', '', '', 0, 0, 1, '2008-06-06 16:49:38', '2013-10-07 17:12:29', '0000-00-00 00:00:00'),
